-- Define valid water tile IDs
local validWaterTileIds = {
    [27725] = true,
    [27728] = true,
    [27729] = true,
    [27730] = true,
    [27731] = true
}                      

-- Function to check if a position is a water tile
function isWaterTile(pos)
    local tile = Tile(pos)
    if not tile then
        return false
    end

    local ground = tile:getGround() -- Get the ground item of the tile
    return ground and validWaterTileIds[ground:getId()]
end          
                                 
                                 
function FindEmptyFishPool_Spot(positionsTable)
                                 
    local itemId = 29636         
                                 
    -- Validate input            
    if not itemId or not positionsTable or #positionsTable == 0  then
        print("Invalid input: itemId or positionsTable is missing or empty.")
        return false             
    end                                                      
                                 
                                 
    local maxAttempts = #positionsTable
    for _ = 1, maxAttempts do    
                                 
        local randomIndex = math.random(1, #positionsTable)
        local position = positionsTable[randomIndex]
                                 
        -- Check if the position already contains the item
        local tile = Tile(position)
        if tile and not tile:getItemById(itemId) and isWaterTile(position) then
                                 
            local newItem = Game.createItem(itemId, 1, position)
            if newItem then      
                print("Item placed at: " .. position.x .. ", " .. position.y .. ", " .. position.z)
                return true      
            end                  
        end                      
    end                          
                                 
    -- If no valid position is fo,und
    print("No valid position found for placing the item.")
    return false
end

function Placepools_ServerStart(positionsTable)

    local itemId = 29636

  -- Validate input
    if not itemId or not positionsTable or #positionsTable == 0 then
        print("Invalid input: itemId or positionsTable is missing or empty.")
        return 0
    end

   
    local amount = math.floor(#positionsTable / 10)

    local placedCount = 0
    local maxAttempts = #positionsTable * 2 -- To avoid infinite loops in case of filled positions

    for _ = 1, amount do
        local attempts = 0
        local placed = false

        while attempts < maxAttempts and not placed do
            local randomIndex = math.random(1, #positionsTable)
            local position = positionsTable[randomIndex]
            local tile = Tile(position)

            -- Check if the position is valid and does not already contain the item
            if tile and not tile:getItemById(itemId) and isWaterTile(position) then
                local newItem = Game.createItem(itemId, 1, position)
                if newItem then
                    placedCount = placedCount + 1
                    placed = true
                end
            end

            attempts = attempts + 1
        end
    end

    print(">> Placed " .. placedCount .. " Fishing pools out of " .. #positionsTable .. " available position.")
    return placedCount
end